import React from "react";

export default function Photos(props){
    if( props.photos) {
  return (
        <section className="photos">
            <div className="row">
            {props.photos.map(function(photo, index) {
  return
  <img src={photo.src.landscape}  key={index}/>;
       })}
       </div>
        </section>
    );
    

}else {
    return null;
}
}
